  \"Review of recent technical information concerning the adverse effects of once-through
  cooling on Lake Michigan\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:01:52.797399\",\n\t\"name\": \"review-of-recent-technical-information-concerning-the-adverse-effects-of-once-through-cool\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The 1970 report showed clearly that the
  potential for damage to this shallow water ecosystem by the electric power generating
  industry, which is the major user of cooling water on Lake Michigan, is indeed great.
  The projections presented showed that by the year 2000 the cooling water requirements
  of the electric power industry located around Lake Michigan would be 91,000 cubic
  feet per second, and that this rate of use would require passing about l% of the
  beach zone water of the entire lake through the cooling system of power generating
  plants daily. The report also described in detail the kinds of immediate and long-range
  effects that were expected to occur as a result of the use of Lake Michigan waters
  for the dissipation of waste heat by once-through cooling. September 19, 1972, revised
  November 1, 1972.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
